import { Button } from 'react-bootstrap';
import { Form } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import Alert from "react-bootstrap/Alert";
function App() {

  const eventSubmit = (event) => {

    PeticionPut().then();


    event.preventDefault();
  }

  const PeticionPut = async (props) => {
    let anio = document.getElementById('anio').value
    let mes = document.getElementById('mes').value
    console.log("añooo" + anio + "mes" + mes)
    let formData = new FormData();
    formData.append('anio', anio);
    formData.append('mes', mes);
    await fetch('/predict',
      {
        method: "POST",
        mode: 'cors',
        headers: {

          'Access-Control-Allow-Origin': 'http://localhost:8080/',

        },
        body: formData

      }).then(res => res.json())
      .catch(error => console.error('Error:', error))
      .then(response => { console.log('Success:', response) });
  }

  const alertSubject = new Subject();
  const defaultId = 'default-alert';

  const alertService = {
    onAlert,
    success,
    error,
    info,
    warn,
    alert,
    clear
  };

   const AlertType = {
    Success: 'Success',
    Error: 'Error',
    Info: 'Info',
    Warning: 'Warning'
  }

  // enable subscribing to alerts observable
  function onAlert(id = defaultId) {
    return alertSubject.asObservable().pipe(filter(x => x && x.id === id));
  }

  // convenience methods
  function success(message, options) {
    alert({ ...options, type: AlertType.Success, message });
  }


  return (
    /* 
        <div className="App">
          <h2>Predicción de incidentes de Tránsito</h2>
          <form onSubmit={eventSubmit}>
            <label>
              Año:
              <input type="text" name="anio" />
            </label>
            <label>
              Mes:
              <input type="text" name="mes" />
            </label>

            <Button variant="danger" type='submit' >Predecir</Button>
          </form>

    */

    <div className="App">
      <Alert />
      <Form onSubmit={eventSubmit} >

        <h2>Predicción de incidentes de Tránsito</h2>
        <button className="btn btn-success m-1" onClick={() => alertService.success('Success!!', options)}>Success</button>
        <Form.Group className="mb-3" >
          <Form.Label>Año</Form.Label>
          <Form.Control type="number" id="anio" required />

          <Form.Text className="">
            Ingresar un año para realizar la Predicción
          </Form.Text>
        </Form.Group>

        <Form.Group className="mb-3" >
          <Form.Label>Ingrese un mes</Form.Label>
          <Form.Control type="number" id="mes" required />
        </Form.Group>

        <Button variant="danger" type="submit">
          Predecir
        </Button>


      </Form>


    </div>

  );
}

export default App;
